import Link from 'next/Link'

const Navbar = () => {
  const styles = {
    display: 'flex',
    background: 'grey',
    alignItems: 'space-between'
  }

  return (
    <div style={styles}>
      <Link href='/about'>
        <a>About Page</a>
      </Link>
      <Link href='/contact'>
        <a>Contact Page</a>
      </Link>
    </div>
  )
}

export default Navbar
